import React from "react";
import { StyleSheet, View } from "react-native";
import { NavigationContainer } from "@react-navigation/native";
import { createStackNavigator } from "@react-navigation/stack";
import { Button } from "react-native-elements";
import { Font } from "expo";
import { Item } from "react-navigation-header-buttons";

import CalendarComponent from "./Screens/Calendar";
import MapComponent from "./Screens/Map";
import HomeComponent from "./Screens/Home";
import Event from "./Screens/Events";
import About from "./Screens/AboutUs";
import Contact from "./Screens/ContactUs";
import ScheduleTourComponent from "./Screens/ScheduleTours";
import LoginComponent from "./Screens/Login";
import DashboardComponent from "./Screens/Dashboard";

const Stack = createStackNavigator();

const createScreen = (name, comp) => {
  return (
    <Stack.Screen
      name={name}
      options={{
        title: " ",
        headerTintColor: "#ea6227",
        headerTransparent: true,
      }}
      component={{ comp }}
    />
  );
};
const App = () => {
  /* const IoniconsHeaderButton = (props) => (
    // the `props` here come from <Item ... />
    // you may access them and pass something else to `HeaderButton` if you like
    <HeaderButton IconComponent={Ionicons} iconSize={23} {...props} />
  ); */

  return (
    // Navigate between multiple screens
    <NavigationContainer>
      <Stack.Navigator>
        createEvent("Home", HomeComponent)
        <Stack.Screen
          name="Calendar"
          options={{
            title: " ",
            headerTintColor: "#ea6227",
            headerTransparent: true,
          }}
          component={CalendarComponent}
        />
        <Stack.Screen
          name="Map"
          options={{
            title: " ",
            headerTintColor: "#ea6227",
            headerTransparent: true,
          }}
          component={MapComponent}
        />
        <Stack.Screen
          name="Event"
          options={{
            title: " ",
            marginRight: "5%",
            headerTintColor: "#ea6227",
            headerTransparent: true,
          }}
          component={Event}
        />
        <Stack.Screen
          name="About Us"
          options={{
            title: " ",
            headerTintColor: "#ea6227",
            headerTransparent: true,
          }}
          component={About}
        />
        <Stack.Screen
          name="Contact Us"
          options={{
            title: " ",
            headerTintColor: "#ea6227",
            headerTransparent: true,
          }}
          component={Contact}
        />
        <Stack.Screen
          name="Schedule Tours"
          options={{
            title: " ",
            headerTintColor: "#ea6227",
            headerTransparent: true,
          }}
          component={ScheduleTourComponent}
        />
        <Stack.Screen
          name="Login"
          options={{
            title: " ",
            headerTintColor: "#ea6227",
            headerTransparent: true,
          }}
          component={LoginComponent}
        />
        <Stack.Screen
          name="Dashboard"
          options={{
            title: " ",
            headerTintColor: "#ea6227",
            headerTransparent: true,
          }}
          component={DashboardComponent}
        />
      </Stack.Navigator>
    </NavigationContainer>
  );
};

export default App;
